import java.util.Scanner;

public class FlipLines {
    public static void flipLines(Scanner input) {
        // TODO: Your code here
        while(input.hasNext()){
            String line = input.nextLine();
            if(input.hasNext()){
                String line2 = input.nextLine();
                System.out.println(line2 + "\n" + line);
            }
            else{
                System.out.println(line); 
            }  
        }
    }

